import { render } from 'react-dom';
import { BrowserRouter } from 'react-router-dom';

import './index.css';
import App from './App';
import Beta from './translate'

render((
  
    <BrowserRouter>
   
        <App/>
        <Beta/>
    </BrowserRouter>
), document.getElementById('root'));
